css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://www.tnctr.com/") {



body{font-family:Arial !important;}
h3#category_board_panel.maintitle, h3#anonymous_element_12.maintitle, h2.maintitle, h3.maintitle, h3#anonymous_element_15
{background:#404040 !important;border-radius:10px 10px 0 0 !important}
.general_box
{border-radius:10px 10px 10px 10px !important;background:#f9f9f9 !important;border-color:#777 !important;}
div.status_update input
{background:#404040 !important;border-radius:5px;}
div#ipbwrapper div#content.clear
{padding-top:10px !important;}
div#submenu-shell
{background:#404040 !important;border-radius:10px 10px 0 0 !important;}
div#user_navigation.logged_in
{background:#404040 !important;border-radius:10px 10px 0 0 !important;padding-bottom:3px !important;border-bottom:0 !important;}
html body#ipboard_body table tbody tr td div#ipbwrapper div#content.clear center table
 {display:none !important;}
span#search_wrap, ul#search_options_menucontent, input.submit_input
{border-radius:5px !important;}
tr.header, tr.header th, .header
{background:#555 !important;}
div#secondary_nav
{margin:0 !important;background:#555 !important; color:#f3f3f3 !important;border-radius:0 0 10px 10px !important;border:none !important;}
div#secondary_nav a
{color:#f3f3f3 !important;}
div.general_box
{border:1px solid #404040 !important;border-radius: 10px !important;}
h3#anonymous_element_13.maintitle, h3#anonymous_element_14.maintitle, div.block_wrap h2.maintitle
{border-radius:10px 10px 10px 10px !important;font-size:10px !important;}
a img.photo
{padding:2px;background:#fff !important;border-color:#999 !important;}
a img.photo:hover
{opacity:0.8 !important;}
html body#ipboard_body table tbody tr td div#ipbwrapper div#content.clear div#board_index.clearfix div#index_stats.right div._sbcollapsable ol iframe
{border:3px solid #555 !important;border-radius:10px !important;padding:0px !important;margin-left:-10px;background:#f3f3f3 !important;}
div#index_stats.right div.block_wrap div.table_wrap table.ipb_table
{border-bottom:0px !important;margin-top:-8px;}
div#index_stats.right div.block_wrap div.table_wrap table.ipb_table tbody tr td.row2
{border-radius:10px !important; border:0px solid #404040 !important;padding:0 !important; }
div#index_stats.right div.block_wrap h3#anonymous_element_12.maintitle
{display:none !important;}
div#user_info p a#user_link.ipbmenu
{background:#555 !important;border:1px solid #aaa !important;border-radius: 10px 0 0 10px !important;}
div#user_info p a#user_link.ipbmenu span
{color:#f3f3f3 !important;}
ul#user_link_menucontent
{border:1px solid #404040 !important;border-radius: 10px !important;}
ul#user_link_menucontent li#user_profile.row1, li#user_profile.row1 a:hover
{border-radius:10px 10px 0 0 !important;}
ul#user_link_menucontent li#user_unread.row1, li#user_unread.row1 a:hover
{border-radius:0 0 10px 10px !important;}
ul#user_link_menucontent li a:hover
{background:#404040 !important;}
p#user_notifications.no-new a#user_notifications_link
{background:#555 !important;border:1px solid #aaa !important;border-radius: 0 10px 10px 0px !important;}
ul#user_notifications_link_menucontent
{border-radius:10px !important;border:0 !important;}
ul#user_notifications_link_menucontent li.row1, ul#user_notifications_link_menucontent li.view-all
{border-radius:10px !important;border:1px solid #555 !important;}
ul#user_notifications_link_menucontent li.row1:hover
{background:#555 !important;color:#f3f3f3 !important;}
ul#user_notifications_link_menucontent li.row1 p span.desc
{color:#999 !important;}
html body#ipboard_body ul#user_notifications_link_menucontent li.row1 a:hover
{color:#f3f3f3 !important;}
form#search-box fieldset a#adv_search
{border-radius:5px !important;padding-right:3px !important;}
div.tab_filters, ol#member_alpha.tab_bar li.active
{background: #444 !important;}
div.tab_filters{border-radius:10px 10px 0 0 !important;}
ol#member_alpha.tab_bar{border-radius:10px 10px 10px 10px !important;}
p.no_messages
{border-radius:0 0 10px 10px !important;}
table#forum_table.ipb_table
{border-bottom:0 !important;}
div.topic_controls ul.pagination li, div.block_wrap div.general_box input.input_submit
{border-radius:4px;}
html body#ipboard_body, #ipboard_body table
{padding:0px !important;margin:0px !important;height:100% !important;}
div#ajax_loading
{left:-8px !important;border-radius:0 0 10px 0 !important;background:#666 !important;}
a#close_sidebar.sidebar_toggle, a#open_sidebar.sidebar_toggle
{border-radius:4px 0 0 4px !important;padding:2px !important;padding-top:3px !important;margin-right:-1px !important;background:#aaa !important;}
html body#ipboard_body table tbody tr td
div#header div#branding
{
background: url(data:image/png;base64,%3D%3D) #f3f3f3 no-repeat 30px 10px !important;}
div#header div#branding img
{ visibility: hidden !important; }
div#header div#branding a
{display:block;}
div.general_box form fieldset.submit
{border-radius:0 0 10px 10px !important;}
div#fast_reply h3.maintitle
{border-radius:10px !important;}
div#fast_reply div.general_box form fieldset.submit input
{border-radius:8px !important;}
div.author_info ul.user_details li.avatar a img
{padding:4px !important;border:1px solid #404040 !important;}
div.author_info ul.user_details li.avatar a img
{border-radius:8px !important;}
div.author_info ul.user_details li.avatar a img:hover
{opacity:0.8 !important;}
div.topic div.post_block
{border-radius:10px !important;border:3px solid #eee !important;}
div.post_block div.post_wrap ul.post_controls
{border-radius:6px !important;background:#ccc !important;}
div.post_block div.post_wrap h3
{border-radius:6px !important;}
div.topic h2.maintitle
{border-radius:10px !important;}
div.status_main_photo a img.photo
{border-radius:4px !important;}
ul#stat_links.filter_bar
{background:#555 !important;}
div#footer
{display:none !important;}
html body#ipboard_body table tbody tr td div#ipbwrapper
{margin-bottom:-25px !important;}
div#categories.clearfix
{overflow:hidden !important;}
ul.topic_buttons li.closed span, ul.topic_buttons li.disabled span
{margin-left:6px !important;}
.general_box h3
{border-radius:7px 7px 0 0 !important;background:#303030 !important;}
ul.post_controls, div.post_controls
{background:none !important;}
table#message_table.ipb_table caption.maintitle
{background:#404040 !important;}
div#user_navigation.not_logged_in
{background:#404040 !important;border-radius:10px 10px 0 0 !important;border-bottom:0 !important;}
div#user_navigation.not_logged_in a#sign_in.rounded
{background:#910000 !important;}
div#toppanel div#panel
{border-radius:0 0 10px 10px !important;}
input#UserName.input_text, input#PassWord.input_text
{border-radius:4px !important;padding:5px !important;font-size:13px !important;font-weight:bold !important;color:#404040 !important;}
form#login input.input_submit
{border-radius:4px !important;}

}
@-moz-document url("http://www.tnctr.com/") {
div#ajax_loading
{display:none !important;}
}
